import { StyleSheet, Text, View, Image } from 'react-native';

export default class Loginscreen extends React.Component {
render(){
 return(
   <View styles={styles.container}> 
    <Text>Please Work</Text>
   </View>
  )
 }
}

const styles = StyleSheet.create({
 container:{
   flex:1,
 },
})
